import React from 'react'
import { Card } from 'react-bootstrap'

const CardServers = ({ server }) => {
	return (
		<Card key={server.id} className='mb-3' style={{ width: '18rem' }}>
			<Card.Img
				variant='top'
				src={
					server?.icon !== null
						? ` https://cdn.discordapp.com/icons/${server?.id}/${server?.icon}.png`
						: `https://via.placeholder.com/150/${
								server.icon || 'CCCCCC'
						  }/FFFFFF?text=Server`
				}
			/>
			<Card.Body>
				<Card.Title>{server.name}</Card.Title>

				<Card.Text>{server.owner && <strong>Owner</strong>}</Card.Text>
				{/* Добавьте другие свойства сервера по необходимости */}
			</Card.Body>
		</Card>
	)
}

export default CardServers
